	(2013, 'Pacific Coffee Short Size e-Coffee Voucher 細杯裝電子咖啡券 Banner ver', '', 1, NULL, NULL, '<div>&nbsp;</div>\n<table style="width: 100%; margin: 0px auto; border-collapse: collapse; max-width: 750px; border: none; font-family: Raleway, 微軟正黑體, \'Microsoft JhengHei\', sans-serif; height: 202px;">\n<tbody>\n<tr style="height: 18px;">\n<td style="width: 100%; height: 18px;"><img src="data:image/png;base64," width="150" /></td>\n</tr>\n<tr style="height: 32px;">\n<td style="padding: 0px 30px; font-size: 28px; text-align: center; height: 32px; width: 100%;">\n<p><img src="data:image/jpeg;base64," width="300" height="370" /></p>\n<p><span style="color: #000000;"><strong>{voucher_description}</strong></span></p>\n</td>\n</tr>\n<tr style="height: 18px;">\n<td style="width: 100%; padding: 10px 0; height: 18px; text-align: center;"><span style="color: #000000;">{qrcode}</span></td>\n</tr>\n<tr style="height: 18px;">\n<td style="width: 100%; padding: 10px 0; height: 18px; text-align: center;"><span style="color: #000000;">&nbsp;</span></td>\n</tr>\n<tr style="height: 26px;">\n<td style="font-size: 22px; text-decoration: none; color: #333333; padding: 0px 30px 30px; text-align: center; height: 26px; width: 100%;">\n<h5><span style="color: #000000;"><strong>電子券編號</strong>：{code_serialno}</span></h5>\n</td>\n</tr>\n<tr style="height: 18px;">\n<td style="width: 100%; height: 18px;">\n<table style="width: 100%; border-collapse: collapse; border-top: 1px solid black; float: left;">\n<tbody>\n<tr style="border-bottom: 1px solid #eeeeee; height: 141px;">\n<td style="width: 18%; color: #777777; padding: 15px 0px 10px 15px; height: 141px;">\n<p><span style="color: #000000;"><strong>商品詳情</strong></span></p>\n<p><span style="color: #000000;"><strong>Description</strong></span></p>\n</td>\n<td style="padding: 15px 15px 10px; width: 39%; height: 141px;">\n<p><span style="color: #000000;">{voucher_description}</span></p>\n<p><span style="color: #000000;">可憑券換領菜單上任何細杯裝手調飲品一杯 (只限熱飲)，特調咖啡、酒調咖啡、樽裝飲品及果汁除外 (如欲升級選用燕麥奶，每杯飲品需額外加$4)</span></p>\n<p><span style="color: #000000;">適用於全線香港Pacific Coffee (銅鑼灣Midtown及亞洲國際博覽館分店除外)</span></p>\n</td>\n<td style="padding: 15px 15px 10px; width: 10%; height: 141px;">&nbsp;</td>\n<td style="padding: 15px 15px 10px; width: 46%; height: 141px;"><span style="color: #000000;"><strong>數量 Quantity</strong></span></td>\n<td style="padding: 15px 15px 10px; width: 216%; height: 141px;"><span style="color: #000000;">1</span></td>\n</tr>\n<tr style="border-bottom: 1px solid #eeeeee; height: 91px;">\n<td style="width: 18%; color: #777777; padding: 10px 0px 10px 15px; vertical-align: middle; height: 91px;">\n<p><span style="color: #000000;"><strong>此電子券有效日期至</strong></span></p>\n<p><span style="color: #000000;"><strong>Valid until</strong></span></p>\n</td>\n<td style="padding: 15px 15px 10px; width: 39%; vertical-align: middle; height: 91px;"><span style="color: #000000;">{voucher_expiry_date}</span></td>\n<td style="padding: 15px 15px 10px; width: 10%; vertical-align: middle; height: 91px;"><span style="color: #000000;">&nbsp;</span></td>\n<td style="padding: 15px 15px 10px; width: 46%; vertical-align: middle; height: 91px;"><span style="color: #000000;">&nbsp;</span></td>\n<td style="padding: 15px 15px 10px; width: 216%; vertical-align: middle; height: 91px;"><span style="color: #000000;">&nbsp;</span></td>\n</tr>\n</tbody>\n</table>\n</td>\n</tr>\n<tr style="height: 18px;">\n<td style="width: 100%; height: 18px; padding: 0 15px; font-size: 14px;">\n<div><span style="color: #000000;">&nbsp;</span></div>\n<div><span style="color: #000000;"><strong>條款及細則:</strong></span></div>\n<div><span style="color: #000000;">請於{voucher_expiry_date}有效日期前使用、逾期作廢</span></div>\n<div><span style="color: #000000;">可憑券換領菜單上任何細杯裝手調飲品一杯 (只限熱飲)，特調咖啡、酒調咖啡、樽裝飲品及果汁除外 (如欲升級選用燕麥奶，每杯飲品需額外加$4)</span></div>\n<div><span style="color: #000000;">此電子券適用於全線香港Pacific Coffee (銅鑼灣Midtown及亞洲國際博覽館分店除外)</span></div>\n<div><span style="color: #000000;">此電子券不可兌換現金及不適用於外賣遞送服務&nbsp;</span></div>\n<div><span style="color: #000000;">此電子券不可與其它優惠同時使用&nbsp;</span></div>\n<div><span style="color: #000000;">必須以電子券上的二維碼換領飲品，而此券之二維碼只可使用一次</span></div>\n<div><span style="color: #000000;">Pacific Coffee Co. Ltd. 將保留此優惠之最終決定權&nbsp;</span></div>\n<div><span style="color: #000000;">&nbsp;</span></div>\n<div><span style="color: #000000;"><strong>Term and conditions:</strong></span></div>\n<div><span style="color: #000000;">Short Size e-Coffee Voucher細杯裝電子咖啡券&nbsp;</span></div>\n<div><span style="color: #000000;">This e-voucher is valid until {voucher_expiry_date}, which is non-extendable&nbsp;</span></div>\n<div><span style="color: #000000;">This e-voucher entitles the holder to redeem any short size handcrafted beverage on menu board (hot only), except specialty coffee, liqueur coffee, bottled drinks and juices (an additional $4 will be charged per beverage to upgrade to oat milk)</span></div>\n<div><span style="color: #000000;">This e-voucher is redeemable at any Pacific Coffee in Hong Kong (except Causeway Bay Midtown and Asia World Expo coffeehouses)</span></div>\n<div><span style="color: #000000;">This e-voucher cannot be exchanged for cash or its equivalent and is not applicable to delivery services</span></div>\n<div><span style="color: #000000;">This e-voucher cannot be used in conjunction with any other promotions or privileges</span></div>\n<div><span style="color: #000000;">Customers must use the QR code to redeem the beverage, and the code is valid for one-time use only</span></div>\n<div><span style="color: #000000;">Pacific Coffee Co. Ltd. reserves the right of final decision in case of disputes</span></div>\n<div><span style="color: #000000;">&nbsp;</span></div>\n<div><span style="color: #000000;"><strong>如何使用 How to use:</strong></span></div>\n<div><span style="color: #000000;">點餐時請出示手機上的QR碼以兌換飲品，條碼限用一次</span></div>\n<div><span style="color: #000000;">Customers must use the QR code to redeem the beverage, and the code is valid for one-time use only</span></div>\n<div><span style="color: #000000;">&nbsp;</span></div>\n<div><span style="color: #000000;"><strong>兌換流程 How to redeem:</strong></span></div>\n<div><span style="color: #000000;">此電子券適用於全線香港Pacific Coffee (銅鑼灣Midtown及亞洲國際博覽館分店除外)</span></div>\n<div><span style="color: #000000;">This e-voucher is redeemable at any Pacific Coffee in Hong Kong (except Causeway Bay Midtown and Asia World Expo coffeehouses)</span></div>\n<div><span style="color: #000000;">&nbsp;</span></div>\n<div><span style="color: #000000;"><strong>營業時間&nbsp;Opening hours:</strong></span></div>\n<div><span style="color: #000000;">Pacific Coffee各分店營業時間不同，請參照官方網站&nbsp;</span><span style="color: #0000ff;"><a style="color: #0000ff;" title="營業時間和分店資料 Opening hour &amp; location" href="https://www.pacificcoffee.com/tc/find-a-store/" target="_blank" rel="noopener">分店資料</a></span></div>\n<div><span style="color: #000000;">For opening hours please click&nbsp;<span style="color: #0000ff;"><a style="color: #0000ff;" title="Opening hour &amp; location" href="https://www.pacificcoffee.com/tc/find-a-store/" target="_blank" rel="noopener">Opening hour</a></span></span></div>\n<div><span style="color: #000000;">&nbsp;</span></div>\n<div><span style="color: #000000;"><strong>如何前往 Direction:</strong></span></div>\n<div><span style="color: #000000;">最新分店詳情請參照官方網站 Update Location details please check website&nbsp;<span style="color: #0000ff;"><a style="color: #0000ff;" title="Location" href="https://www.pacificcoffee.com/tc/find-a-store/" target="_blank" rel="noopener">(Web網站)</a></span></span></div>\n<div><span style="color: #000000;">&nbsp;</span></div>\n<div><span style="color: #000000;"><strong>中環 Central</strong></span><br /><span style="color: #000000;">中環擺花街43號地下 LYNDHURST TERRACE G/F, The Workstation, 43 Lyndhurst Terrace<span style="color: #0000ff;"><a style="color: #0000ff;" title="（地圖 Map)" href="https://goo.gl/maps/BiWm7wVtw4F2" target="_blank" rel="noopener">（地圖 Map)</a></span></span><b